import { getTime } from '../apiHandlers/clockapi';
import React from 'react';

export default () => {
  async function fetchTime() {
    const data = await getTime();
  };
  return (
    <div className="clock">
      <h2 id="clock"></h2>
      <script> 
        document.getElementById("clock").innerHTML = data;
      </script>
    </div>
  );
};
